import {useEffect} from "react";
function App() {
    useEffect(() => {
        fetch("/api")
            .then((res) => res.json())
            .then((data) => console.log(data) );
    }, []);
  return (
    <div className="App">
      <h1>Login Page</h1>
    </div>
  );
}

export default App;
